 <p>G3383<br>  &#x3bc;&#x3b7;&#769;&#x3c4;&#x3b5;  <br> me&#772;te  <br><i>may&#8216;-teh </i><br>From <a href="g3361">3361</a> and <a href="g5037">5037</a>  <i>not</i> <i>too</i>, that is, (in continued negation) <i>neither</i> or <i>nor</i>; also, <i>not</i> <i>even:</i> - neither, (n-) or, so much as.<br></p>
